import React, { useState, useEffect } from 'react';
import { Line, Pie } from 'react-chartjs-2';
import { useNavigate } from 'react-router-dom';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Filler,
  Tooltip,
  Legend,
  ArcElement,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Filler,
  Tooltip,
  Legend,
  ArcElement
);

const ExpenseTracker = () => {
  const navigate = useNavigate();
  const [date, setDate] = useState('');
  const [expenses, setExpenses] = useState([]);
  const [totalExpenses, setTotalExpenses] = useState(0);
  const [category, setCategory] = useState('Food');
  const [customCategory, setCustomCategory] = useState('');
  const [editingExpense, setEditingExpense] = useState(null);
  const [amount, setAmount] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/');
      return;
    }
    fetchExpenses();
  }, [navigate]);

  const fetchExpenses = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch('http://localhost:5000/api/expenses', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      if (response.ok) {
        const data = await response.json();
        setExpenses(data.expenses);
        setTotalExpenses(data.totalExpenses);
      } else if (response.status === 401) {
        localStorage.removeItem('token');
        navigate('/');
      }
    } catch (error) {
      console.error('Error fetching expenses:', error);
    }
  };

  const handleAddExpense = async (event) => {
    event.preventDefault();
    const token = localStorage.getItem('token');

    if (!token) {
      navigate('/');
      return;
    }

    const amountValue = parseFloat(amount);
    const categoryValue = category === 'Other' ? customCategory : category;

    if (!date || isNaN(amountValue) || !categoryValue) {
      alert('Please fill in all fields correctly');
      return;
    }

    try {
      const response = await fetch('http://localhost:5000/api/expenses', {
        method: editingExpense ? 'PUT' : 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify({
          date,
          category: categoryValue,
          amount: amountValue,
          ...(editingExpense && { id: editingExpense._id })
        })
      });

      if (response.ok) {
        resetForm();
        fetchExpenses(); // Refresh the expenses list
      } else if (response.status === 401) {
        localStorage.removeItem('token');
        navigate('/');
      } else {
        const error = await response.json();
        alert(error.msg);
      }
    } catch (error) {
      console.error('Error saving expense:', error);
      alert('Failed to save expense. Please try again.');
    }
  };

  const lineChartData = {
    labels: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'],
    datasets: [{
      label: 'Weekly Spending',
      data: [120, 190, 300, 500, 200, 300, 400],
      fill: true,
      backgroundColor: 'rgba(75,192,192,0.2)',
      borderColor: 'rgba(75,192,192,1)',
    }]
  };

  const pieChartData = {
    labels: ['Food', 'Transport', 'Entertainment', 'Shopping', 'Others'],
    datasets: [{
      data: [300, 50, 100, 80, 150],
      backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#66BB6A', '#FF7043']
    }]
  };

  const chartOptions = {
    maintainAspectRatio: false,
  };

  const chartContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '300px', // Adjust height as needed
    width: '100%',
  };

  const chartStyle = {
    height: '100%',
    width: '100%',
    maxWidth: '400px', // Ensures both charts have same max width
  };

  return (
    <div className="container">
      <div className="row mt-5">
        <div className="col-md-6">
          <h3>Spending Trends</h3>
          <div style={chartContainerStyle}>
            <Line 
              data={lineChartData} 
              options={chartOptions} 
              style={chartStyle}
            />
          </div>
        </div>
        <div className="col-md-6">
          <h3>Category Breakdown</h3>
          <div style={chartContainerStyle}>
            <Pie 
              data={pieChartData} 
              options={chartOptions} 
              style={chartStyle}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default ExpenseTracker;
